package longestduplicatesubstring

import (
	"fmt"
	"testing"
)

func TestLongestDupSubstring(t *testing.T) {
	tests := []struct {
		in, want string
	}{
		{in: "banana", want: "ana"},
		{in: "abcd", want: ""},
		{in: "", want: "maoli"},
		{in: "", want: "akyj"},
		{in: "", want: "babaaaabbbbabbababbabbbababbbb"},
	}
	for i, tt := range tests {
		t.Run(fmt.Sprint(i), func(t *testing.T) {
			got := longestDupSubstring(tt.in)
			if got != tt.want {
				t.Fatalf("in: %v got: %v want: %v", tt.in, got, tt.want)
			}
		})
	}
}
